  false,\n\t\"url\": null,\n\t\"notes\": \"EM1002 and EM120 multibeam Data were collected
  in October/November 2002 aboard R/V Kilo Moana between Kauai Island and Lisianski
  Island in the Northwestern Hawaiian Islands (NWHI). Multibeam data were collected
  using Simrad Neptune software, converted to the Generic Sensor Format, and processed
  using SABER editing software. Sound velocity corrections from CTD's and motion corrections
  from a POS-MV vertical reference were applied to the data in real time. No tidal
  correctors were applied in real-time or in post-processing. The EM1002 has heave
  artifacts (~0.6m) in shallow bank-top data. Horizontal accuracy is 20m (no differential
  GPS correctors applied), vertical accuracy is depth dependent (~1% of water depth),
  WGS84 datum. These data are not to be used for navigation. Depths mapped range from
  30-5200 meters below sea level.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
